// https://www.digitalocean.com/community/tutorials/react-axios-react

import React from 'react';
import axios from 'axios';

export default class TestGet extends React.Component {
  state = {
    persons: []
  }
  componentDidMount() { 
    axios.get("http://localhost:8666/service/sasl", {}, {

      auth: {
        'qpid-admin':'supersecret'
      }
    })
    (response => this.setState({ users: response.data.data }))
}

  render() { //TODO sette opp table
    return (
      <table>
        <tr>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th> 
        </tr>
        {
          this.state.persons
            .map(person =>
                <tr key={person.id}>
                    <td>{person.name}</td>
                    <td>{person.username}</td>
                    <td>{person.email}</td>
                </tr>
            )
        }
      </table>
    )
  }
}
